import styled from "styled-components";
import React from "react";
import { Link } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import { useState, useEffect } from "react";
import Profile from "../assets/depression3747_hitpaw.com.png";
import Ogo from "../assets/logo.png";
import Person3Icon from "@mui/icons-material/Person3";
import Userinfo from "../Componenst/Userinfo"
const Container = styled.div`
  height:60px;
`;

const Wrapper = styled.div`
  padding: 20px 20px;
  display: flex;
  align-items: center;
  justify-content: space-between;
  background-color: #067cf8;
  color: #4a4758;
`;
const Left = styled.div`
  flex: 1;
  display: flex;
  align-items: center;
`;
const Logo = styled.div`
  font-size: 28px;
  text-decoration: none;
  color: #fff;
  font-weight: bold;
`;

const Center = styled.div`
  flex: 1;
  text-align: center;
`;

const Right = styled.div`
  flex: 1;
  display: flex;
  align-items: center;
  justify-content: space-around;
`;
const Advices = styled(Link)`
  font-size: 18px;
  font-weight: bold;
  cursor: pointer;
  color: #fff;
  text-decoration: none;
  &:hover {
    letter-spacing: 2px;
    color: #fff;
    transition: all 0.4s ease-in;
    -moz-transition: all 0.4s ease-in;
    -webkit-transition: all 0.4s ease-in;
    -ms-transition: all 0.4s ease-in;
    -o-transition: all 0.4s ease-in;
  }
`;
const Home = styled(Link)`
  font-size: 18px;
  font-weight: bold;
  cursor: pointer;
  color: #fff;
  text-decoration: none;
  &:hover {
    letter-spacing: 2px;
    color: #fff;
    transition: all 0.4s ease-in;
    -moz-transition: all 0.4s ease-in;
    -webkit-transition: all 0.4s ease-in;
    -ms-transition: all 0.4s ease-in;
    -o-transition: all 0.4s ease-in;
  }
`;
const About = styled(Link)`
  font-size: 18px;
  font-weight: bold;
  cursor: pointer;
  color: #fff;
  text-decoration: none;
  &:hover {
    letter-spacing: 2px;
    color: #fff;
    transition: all 0.4s ease-in;
    -moz-transition: all 0.4s ease-in;
    -webkit-transition: all 0.4s ease-in;
    -ms-transition: all 0.4s ease-in;
    -o-transition: all 0.4s ease-in;
  }
`;
const Contact = styled(Link)`
  font-size: 18px;
  font-weight: bold;
  cursor: pointer;
  color: #fff;
  text-decoration: none;
  &:hover {
    letter-spacing: 2px;
    color: #fff;
    transition: all 0.4s ease-in;
    -moz-transition: all 0.4s ease-in;
    -webkit-transition: all 0.4s ease-in;
    -ms-transition: all 0.4s ease-in;
    -o-transition: all 0.4s ease-in;
  }
`;

function Nav2() {
  const [theme, setTheme] = useState("light");

  useEffect(() => {
    if (theme === "light") {
      document.body.classList.remove("dark");
    } else {
      document.body.classList.add("dark");
    }
  }, [theme]);

  function toggleTheme() {
    if (theme === "light") {
      setTheme("dark");
    } else {
      setTheme("light");
    }
  }

  const navigate = useNavigate();

  const handleAccountClick = (event) => {
    event.preventDefault();
    navigate("/account/my-account");
  };
  return (

     <>
     <nav>

        <Userinfo/>

        <div className="">
            {/* <img src={Profile}/> */}
            <img src={Ogo} className="l"/>

          </div>

          <Home to="/home">Home</Home>

          <About to="/about">About</About>

          <Advices to="/advices">Advices</Advices>

          <Contact to="/Quiz">Test</Contact>

     </nav>
     </>   
  );
}

export default Nav2;
